import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import ProductList from './components/ProductList';
import Product from './components/Product';
import Cart from './components/Cart';
import Login from './components/Login';
import Register from './components/Register';
import Profile from './components/Profile';
import Shipping from './components/Shipping';
import Payment from './components/Payment';
import PlaceOrder from './components/PlaceOrder';
import Order from './components/Order';
import AdminPanel from './components/AdminPanel';
import ProductListAdmin from './components/ProductListAdmin';
import ProductEdit from './components/ProductEdit';
import OrderListAdmin from './components/OrderListAdmin';
import UserListAdmin from './components/UserListAdmin';
import UserEditAdmin from './components/UserEditAdmin';
import NotFound from './components/NotFound';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <Router>
      <Header />
      <main className="py-3">
        <Container>
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<ProductList />} exact />
            <Route path="/product/:id" element={<Product />} />
            <Route path="/cart" element={<Cart />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            
            {/* Private Routes */}
            <Route path="/profile" element={<Profile />} />
            <Route path="/shipping" element={<Shipping />} />
            <Route path="/payment" element={<Payment />} />
            <Route path="/placeorder" element={<PlaceOrder />} />
            <Route path="/order/:id" element={<Order />} />
            
            {/* Admin Routes */}
            <Route path="/admin" element={<AdminPanel />} />
            <Route path="/admin/productlist" element={<ProductListAdmin />} />
            <Route path="/admin/product/:id/edit" element={<ProductEdit />} />
            <Route path="/admin/orderlist" element={<OrderListAdmin />} />
            <Route path="/admin/userlist" element={<UserListAdmin />} />
            <Route path="/admin/user/:id/edit" element={<UserEditAdmin />} />
            
            {/* 404 */}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </Container>
      </main>
    </Router>
  );
}

export default App;
